import { Link, useMatch, useResolvedPath } from "react-router-dom"

export default function Header() {
  const path = window.location.pathname
  return (
    <div className="Header">
      <Link to="/" >Home</Link>
      <h1>Work/Title</h1>
    </div>
  )
}
